import { useState } from "react";
import "./App.css";

function App() {
  const [content, setContent] = useState("Welcome to Admin Portal. Select a menu item to begin.");

  const loadContent = (section) => {
    switch (section) {
      case "dashboard":
        setContent("Dashboard: Overview of system stats.");
        break;
      case "users":
        setContent("Users: Manage user accounts.");
        break;
      case "settings":
        setContent("Settings: System configuration options.");
        break;
      case "history":
        setContent("History: View system logs and activity.");
        break;
      default:
        setContent("Welcome to Admin Portal. Select a menu item to begin.");
    }
  };

  return (
    <div className="container">
      {/* Sidebar */}
      <div className="sidebar">
        <a href="#" onClick={() => loadContent("dashboard")}>Dashboard</a>
        <a href="#" onClick={() => loadContent("users")}>Users</a>
        <a href="#" onClick={() => loadContent("settings")}>Settings</a>
        <a href="#" onClick={() => loadContent("history")}>History</a>
      </div>

      {/* Main Content */}
      <div className="content">
        <h1>Admin Portal</h1>
        <p>{content}</p>
      </div>
    </div>
  );
}

export default App;
